import React, { Component } from 'react';
import './Header.css'
import Dehaze from "@material-ui/icons/Dehaze";
import { Picture } from 'react';
import CardHeader from '@material-ui/core/CardHeader';


export default class Headers extends Component {
    render(props) {
        return (
            <div>
                <ul>
                    <li><a> <Dehaze
                    onClick={props.click}
                        fontSize="inherit"
                        style={{ fontSize: "30px" }}
                    /></a></li>
                    <li><a></a></li>
                    <li><a></a></li>
                    <li><a></a></li>
                </ul>
            </div>
        )
    }
}
